sys_variable_value.value:
(function execute(inputs, outputs) {
    var users = [];

  if (inputs.responseBody) {

  	var returnedObject = JSON.parse(inputs.responseBody);
    var userArray = returnedObject.Users;
    if (userArray) {
    for (var i=0; i<userArray.length; i++) {
      var userObject = userArray[i];
      var user = {};
         user.username = userObject.UserName;
      	 users.push(user);
         }
       }
   }
  outputs.total = returnedObject.Total;
  outputs.users = users;
})(inputs, outputs);

